    "2014-04-24T15:02:51.571316",nt"name": "air-quality-and-air-quality-related-values-in-chassahowitzka-national-wildlife-refuge-and-",nt"isopen":
    false,nt"url": null,nt"notes": "Chassahowitzka Wilderness Area is a Class
    I air quality area administered by the U.S. Fish and Wildlife Service. Despite the
    special protection mandated for Chassahowitzka by the Wilderness Act and the Clean
    Air Act, resources in the area are affected by poor air quality. This report presents
    available information on the air quality and on the resources sensitive to air quality
    in Chassahowitzka. It also identifies the need for additional inventory, monitoring,
    and research. Air quality in Chassahowitzka is affected by many nearby stationary,
    mobile, and area sources. The largest stationary sources of sulfur dioxide, nitrogen
    oxides, and particulate matter in Florida are located within 100 km of Chassahowitzka.
    In addition, the Tampa metropolitan area, approximately 60 km south of the wilderness
    area, contributes significant mobile and area emissions. Resources in Chassahowitzka
    potentially sensitive to air quality include vegetation, wildlife, water, soils,
    and visibility. For example, several species of plants and lichens found in Chassahowitzka
    are sensitive to ozone or sulfur dioxide pollution. As a result, these species may
    experience leaf injury and reduced growth and productivity. Shallow saltwater ecosystems
    in Chassahowitzka are sensitive to nitrogen deposition from the atmosphere. This
    additional nitrogen may fertilize these waters, causing algal blooms, reduced water
    quality, and loss of seagrass beds important to many species of fish and wildlife.
    In addition, visibility in Chassahowitzka is reduced by haze resulting from high
    concentrations of pollutant particles in the air.",nt"license_title": "License
